import React from 'react';
import {Menu} from 'semantic-ui-react';

export default () => {
  return (
    <Menu tabular>
      <Menu.Item
        name='main'
        onClick={this.handleItemClick}
      />
      <Menu.Item
        name='edit'
        onClick={this.handleItemClick}
      />
    </Menu>
  );
}
